svg.script:
// 
function init() {
  var paths = document.querySelectorAll('path'),
    i = 0,
    randTimeout = null;
    path = null;
  for (i = 0; i < paths.length; i++) {
    let path = paths[i];
    randTimeout = Math.floor(Math.random() * (1500 - 1) + 1);
    path.style.animationDelay = randTimeout + 'ms';
    path.classList.add('is-animated');
  }
}
//
